import './App.css';
import React from "react";
import Navbar from './components/Navbar';
import TableI from './components/table';
import './favicon.ico';


function App() {
  return (
    <>
    <nav > 
      <img src='favicon.ico'></img>
      <h1>Lista de Alumnos</h1>
      </nav>
    <Navbar />
    <div className='derecha'> 
      <TableI />
    </div>
    </>
  );
}

export default App;
